import React, { Component } from 'react';
import './App.css';
import Profile from './Components';

class App extends Component {
  render() {
    return (
      <div className="App">
        <div className="myname">
          <h1>Brad Vatne</h1>
          <p>Interactive Resume</p>
        </div>
        <Profile />
      </div>
    );
  }
}

export default App;
